application: gcontactse164
version: 1
runtime: python27
api_version: 1
threadsafe: yes

handlers:
- url: /favicon\.ico
  static_files: favicon.ico
  upload: favicon\.ico

- url: /js
  static_dir: js

- url: /style
  static_dir: style

- url: /
  static_files: index.html
  upload: index.html

libraries:
- name: webapp2
  version: "2.5.2"
